import React from "react";
import worksLine from "../../../../public/assets/landing page/works-line.png";

const Works = () => {
  return (
    <div className="pt-24 max-sm:mt-40" id="works">
      <h1 className="text-6xl max-sm:text-4xl font-medium">How it works?</h1>
      <p className="text-gray-200 mt-3">
        Competing with Kode! is as easy as 1-2-3.
      </p>
      <div className="relative">
        <div className="absolute right-[20%]">
          <h1 className="text-3xl w-[12em]">
            <span className="text-[#179585]">1. Create</span> Your Account
          </h1>
          <p className="text-gray-200 w-[21em]">Sign up in seconds and unlock access to a world of coding challenges.</p>
        </div>
        <img src={worksLine} width={600} className="mx-auto mt-10" />
      </div>
    </div>
  );
};

export default Works;
